<html>
<body>
    <form name="sheet">
        <input name="entry.38652195" type="text" required/>
        <input type="submit" />
      </form>
      <div id="form-success">
      </div>  
    <script>
    const scriptURL = 'https://docs.google.com/forms/u/0/d/e/1FAIpQLSfvCS86L-fpI7Er2ta0uuqPhfbANMiO977dhXmPjOTwOgBz5w/formResponse'
    const form = document.forms['sheet'];
    form.addEventListener('submit', e => {
    e.preventDefault()
    // Registered(e)
    fetch(scriptURL, { method: 'POST', body: new FormData(form)})
    .then(response => alert("HELLo"))
    .catch(error => console.error('Error!', error.message))
  })
      </script>
</body>
</html>
